import React, { Component } from "react";
import {Col, Row, Container} from "../components/Grid";
import Nav from "../components/Nav";
import OutlineBtn from "../components/DeleteBtn/index.js";
import test from "../images/image_seven.png";
import logo from "../images/logo_2.png";
import ("../pages/home.css");



class Home extends Component {
    render(){
        return(
            <Container>
               
                <div className="test">
                
                    <Row>
                        <Col size="md">
                        <Nav>
                        <a className="navbar-brand" href="/">
                <img src={logo} alt="logo"/> 
                </a>
                            <OutlineBtn><i className="fas fa-sign-in-alt">Log-Out</i></OutlineBtn></Nav>
                        <img src={test} style={{opacity:"0.7", width:1500, marginTop:100, borderTop:"solid white 10px"}} alt="strawberries"/>
                        </Col>
                    </Row>

                </div>
                <Row>
                    <Col size="md"></Col>
                    <Col size="md"></Col>
                </Row>
            </Container>
        )
    }
}

export default Home;
